description:
The in vivo histology using MRI (hMRI) toolbox provides software to convert conventional MRI imaging data into quantitative maps describing the microstructural organisation of human brain tissue. 

It also provides functionality to analyse group-wise or inter-individual differences to better understand various neurological or behavioural differences.

Now that the tool has been made public, we are seeking funding to:
1. expand and support our new user group;
2. make it easier for developers to contribute by developing a continuous integration platform;
3. Incorporate independent user feedback and demands into the project's roadmap.

Diffusion MRI enables the non-invasive assessment of the microscopic properties of brain tissue. Of particular interest is the brain white matter, which contains neuronal axons connecting distant areas of the grey matter in order to facilitate long-range integration of neuronal function; these form large coherent fibre bundles at the millimetre scale. By sensitising MR images to the diffusion of water molecules, the orientations and densities of these white matter bundles can be estimated. Furthermore, using tractography it is possible to estimate the spatial trajectories followed by these bundles, and hence the grey matter areas they connect.

MRtrix3 provides state-of-the-art tools for the analysis of diffusion MRI data. These include:
- Image pre-processing;
- Biophysical modelling through the spherical deconvolution technique;
- Streamlines tractography for reconstruction of white matter fibres;
- Construction of the brain structural connectivity network ("structural connectome");
- Tailored statistical inference of changes in microscopic and morphological white matter fibre bundles;
- Various utilities for image data manipulation;
- Visualisation of neuroimaging data and various derived reconstructions.

In collaboration with multiple researchers, our laboratory has developed novel system identification algorithms for data-driven modeling of nonlinear, dynamic, biomedical systems. These have been implemented  in an open-source, object-oriented,  MATLAB toolbox - NLID. Models estimated with NLD provide quantitative descriptions of system dynamics,  can predict the response  to novel inputs, and their parameterizations are useful  for classification and diagnosis using machine learning. The  toolbox has been used in biomedical research,  especially to study joint neuromechanics.
The widespread adoption of NLID has been limited because it is based on MATLAB, a commercial product with significant licensing and maintenance costs. There  is a clear demand for an implementation of the NLID toolbox algorithms and methods in an open-source language that will enable community-driven development. We  believe that this can best be achieved by  porting the toolbox to Python.
This project will port the MATLAB NLID toolbox to Python as an open source package that will  include routines for time-invariant and/or time-varying identification of:
1) Linear dynamic models comprising impulse response function models, frequency response function, state-space models;
2) Block-oriented nonlinear models with Hammerstein, Wiener, sandwich, and parallel-cascade structures;
3) Nonlinear dynamic models based on the  Voltera and Wiener basis expansions.
